import { GET_PLAYERS, ADD_PLAYER, DELETE_PLAYERS } from '../actions/types.js';

const initialState = {
  warningIsActive: false
}

export default function(state = initialState, action) {
  switch(action.type) {
    case TOGGLE:
      return {
        ...state
      };
    default:
      return state;
  }
}
